import{_ as n}from"./plugin-vue_export-helper.21dcd24c.js";import{o as i,c as r,b as t,a as l,w as d,d as e,e as s,r as o}from"./app.a02d6c3e.js";const u={},h=e("Hieronder kan je de release notes vinden van de MyParcel backoffice. Elke maand doen we twee releases voor de backoffice. Relevante dingen zullen hieronder benoemd worden. Als je vragen hebt over een release, neem dan "),w=e("contact"),c=e(" met ons op."),f=s('<h2 id="release-notes-week-52" tabindex="-1"><a class="header-anchor" href="#release-notes-week-52" aria-hidden="true" tabindex="-1">#</a> Release notes week 52</h2><p><em>30-12-2022</em></p><h4 id="nieuwe-features" tabindex="-1"><a class="header-anchor" href="#nieuwe-features" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Deze keer hebben we geen spannende nieuwe features gebouwd. We wensen je een fijne jaarwisseling!</li></ul><h2 id="release-notes-week-50" tabindex="-1"><a class="header-anchor" href="#release-notes-week-50" aria-hidden="true" tabindex="-1">#</a> Release notes week 50</h2><p><em>14-12-2022</em></p><h4 id="nieuwe-features-1" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-1" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Nieuwe versie Amazon integratie <ul><li>Onze integratie met Amazon heeft een update gekregen: koppelen met Amazon in plaats van in de backoffice een client-id en een secret in te voeren, word je nu met een klik op de knop naar Amazon gestuurd om daar de koppeling goed te keuren. Daarna kan je meteen zendingen importeren vanaf het zendingoverzicht. Tot 1 januari kan je gewoon zendingen blijven importeren met je oude koppeling, daarna zal je even opnieuw moeten koppelen en kan je weer verder.</li></ul></li><li>Afmetingen in het nieuwe zendingformulier <ul><li>Je kan nu in het nieuwe zendingformulier onder Extra informatie de afmetingen van je pakket invullen. Vanaf een bepaalde grootte wordt automatisch <em>Groot pakket</em> gekozen voor je zending: zo kom je niet voor verrassingen te staan.</li></ul></li><li>Datum en tijd in het case detailovericht <ul><li>Vanaf nu wordt niet alleen de datum, maar ook de tijd van berichten over een case getoond.</li></ul></li></ul><h2 id="release-notes-week-47" tabindex="-1"><a class="header-anchor" href="#release-notes-week-47" aria-hidden="true" tabindex="-1">#</a> Release notes week 47</h2><p><em>24-11-2022</em></p><h4 id="nieuwe-features-2" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-2" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>bpost en DPD op eigen contract <ul><li>Op ons Belgisch platform kan je nu zendingen doen op je eigen contract met bpost of DPD.</li></ul></li></ul><h2 id="release-notes-week-46" tabindex="-1"><a class="header-anchor" href="#release-notes-week-46" aria-hidden="true" tabindex="-1">#</a> Release notes week 46</h2><p><em>17-11-2022</em></p><h4 id="nieuwe-features-3" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-3" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Voortgang .CSV import <ul><li>Als je een .CSV bestand met zendingen uploadt, wordt nu de voortgang getoond, waardoor je precies kan zien hoe ver we zijn met zendingen uploaden.</li></ul></li><li>Orderbeheer voor SendMyParcel.be <ul><li>Ook op ons Belgische platform kan je nu je orders uploaden en beheren.</li></ul></li></ul><h2 id="release-notes-week-44" tabindex="-1"><a class="header-anchor" href="#release-notes-week-44" aria-hidden="true" tabindex="-1">#</a> Release notes week 44</h2><p><em>03-11-2022</em></p><h4 id="nieuwe-features-4" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-4" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Deze keer hebben we geen spannende nieuwe features gebouwd.</li></ul><h4 id="bugfixes" tabindex="-1"><a class="header-anchor" href="#bugfixes" aria-hidden="true" tabindex="-1">#</a> Bugfixes</h4><ul><li>Orderbeheer <ul><li>De order .CSV import deed het niet en het was onmogelijk om orders aan te passen. Dat kan nu allebei wel weer.</li></ul></li><li>Bezorgmoment <ul><li>Als je een zending met een bezorgmoment had aangemaakt, kon je dat bezorgmoment niet meer aanpassen. Dat kan nu wel weer.</li></ul></li></ul><h2 id="release-notes-week-42" tabindex="-1"><a class="header-anchor" href="#release-notes-week-42" aria-hidden="true" tabindex="-1">#</a> Release notes week 42</h2><p><em>21-10-2022</em></p><h4 id="nieuwe-features-5" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-5" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Nieuwe caseformulier opgeschoond <ul><li>We hebben het nieuwe caseformulier strak getrokken, zodat die er wat beter uitziet.</li></ul></li></ul><h4 id="bugfixes-1" tabindex="-1"><a class="header-anchor" href="#bugfixes-1" aria-hidden="true" tabindex="-1">#</a> Bugfixes</h4><ul><li>Bulk download labels <ul><li>Als je meerdere labels in \xE9\xE9n keer wilde printen, werd niet automatisch de status van die zendingen ge\xFCpdatet. Nu gebeurt dat wel weer.</li></ul></li></ul><h2 id="release-notes-week-40" tabindex="-1"><a class="header-anchor" href="#release-notes-week-40" aria-hidden="true" tabindex="-1">#</a> Release notes week 40</h2><p><em>06-10-2022</em></p><h4 id="nieuwe-features-6" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-6" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Deze keer hebben we geen spannende nieuwe features gebouwd.</li></ul><h4 id="bugfixes-2" tabindex="-1"><a class="header-anchor" href="#bugfixes-2" aria-hidden="true" tabindex="-1">#</a> Bugfixes</h4><ul><li>Retourknop in portaal <ul><li>De retourknop in het portaal werd niet getoond ook al had je die wel aangevinkt in de portaalinstellingen. Nu is hij er weer.</li></ul></li><li>Zendingoverzicht Google Chrome Extensie <ul><li>Het zendingoverzicht in de MyParcel Google Chrome Extensie was stuk: die hebben we gerepareerd.</li></ul></li></ul><h2 id="release-notes-week-38" tabindex="-1"><a class="header-anchor" href="#release-notes-week-38" aria-hidden="true" tabindex="-1">#</a> Release notes week 38</h2><p><em>21-09-2022</em></p><h4 id="nieuwe-features-7" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-7" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Deze keer hebben we geen spannende nieuwe features gebouwd.</li></ul><h4 id="bugfixes-3" tabindex="-1"><a class="header-anchor" href="#bugfixes-3" aria-hidden="true" tabindex="-1">#</a> Bugfixes</h4><ul><li>Nieuwe zendingformulier <ul><li>Als je bij het aanmaken van een zending eerst de carrier koos en daarna het pakkttype aanpaste, verdween het bonnetje en kon je de zending niet opslaan. Nu blijft het bonnetje gewoon hangen en kan je wel de zending opslaan.</li></ul></li><li>Case aanmaken vanaf het zendingoverzicht <ul><li>De link, waarmee je vanuit de Track &amp; Trace informatie van een zending een case kon aanmaken, was verdwenen. Nu is hij er weer.</li></ul></li></ul><h2 id="release-notes-week-37" tabindex="-1"><a class="header-anchor" href="#release-notes-week-37" aria-hidden="true" tabindex="-1">#</a> Release notes week 37</h2><p><em>15-09-2022</em></p><h4 id="nieuwe-features-8" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-8" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li>Deze keer hebben we geen spannende nieuwe features gebouwd.</li></ul><h2 id="release-notes-week-34" tabindex="-1"><a class="header-anchor" href="#release-notes-week-34" aria-hidden="true" tabindex="-1">#</a> Release notes week 34</h2><p><em>25-08-2022</em></p><h4 id="nieuwe-features-9" tabindex="-1"><a class="header-anchor" href="#nieuwe-features-9" aria-hidden="true" tabindex="-1">#</a> Nieuwe features</h4><ul><li><p>Redesign Haalservice overzicht</p><ul><li>Het Haalservice overzicht is nu overzichtelijker. Daarnaast hebben we een aantal nieuwe statussen toegevoegd, zodat we je beter kunnen informeren over lopende Haalservices.</li></ul></li><li><p>Filteren op vervoerders</p><ul><li>In het zendingoverzicht kan je zendingen filteren op basis van o.a. de vervoerder. We tonen hier nu alleen vervoerders die actief zijn in de huidige shop. Als je <em>Alle shops</em> hebt geselecteerd, kijken we naar de vervoerders van alle shops.</li></ul></li></ul>',48);function b(k,m){const a=o("AutoLink");return i(),r("div",null,[t("p",null,[h,l(a,{item:"https://backoffice.myparcel.nl/contact"},{default:d(()=>[w]),_:1}),c]),f])}var x=n(u,[["render",b],["__file","20.frontend.html.vue"]]);export{x as default};
